import React from 'react';
import Navbar from '../components/navbar';
import Footer from '../components/footer';
import Header from '../components/HeaderAbout';

class Contact extends React.Component {
    render() {
        return(
<div>
                <Navbar/>
                <Header/>
                <Footer/>
</div>

        )
    }
}

export default Contact;
